import React, { Component } from 'react'
import OrderDetails from './Components/orderDetails'
import MerchantDetails from './Components/merchantDetails'

export default class OrderHistory extends Component {
    constructor() {
        super()
        this.state = {
            orderHistory: [],
            fetch: false
        }
    }

    componentDidMount() {
        fetch('/orderhistory')
            .then((res) => res.json())
            .then(res => this.setState({
                orderHistory: res,
                fetch: true
            }))
    }

    render() {

        const orderHistory = this.state.orderHistory.map((orderHistory, index) => {
            return (<div>
                <div key={index}>{orderHistory.receipt_id}</div>
                <MerchantDetails merchant_id={orderHistory.merchant_id} />
                <OrderDetails receipt_id={orderHistory.receipt_id} />
            </div>)
        })

        return (
            <div className='orderHistoryWrapper'>
                {this.state.fetch ? orderHistory : null}
            </div>
        )

    }
}
